import React, { useState } from 'react'

import './Login.css'
import { Button, Form, FormGroup, Label }
    from 'reactstrap'
import Inputi from './Input'
import axios from 'axios'


const Login = () => {

    const [user, setUser] = useState('');
    const [password, setPassword] = useState('');

    function handleChange (name , value){
        if(name === 'usuario'){
            setUser(value)
        }
        else{             
            setPassword(value)            
        }
    }
    console.log('usuario: ',user);
    console.log('password: ',password)
    //onSubmit= async e =>{
      //  awit axios.post('http://localhost:8080/users/login',{
        //    email: user,
          //  name:
        //})
        //e.preventDefault();
    //} 

    return (
        <div className="completo">
            <Form className="login-form">
                <h1 className="font-w">Cripto App</h1>
                <h2 className="text-center">Bienvenido</h2>
                <FormGroup>
                    <Label className="usuario-l">Usuario</Label>
                    <Inputi
                    atribute={{
                        id:'usuario',
                        name:'usuario',
                        type:'text',
                        placeholder:'Ingrese su usuario'
                    }}
                    handleChange={handleChange}
                    className="usuario-i"
                />
                    
                </FormGroup>
                <FormGroup>
                    <label>Contraseña</label>
                    <Inputi
                    atribute={{
                        id:'contraseña',
                        name:'contraseña',
                        type:'password',
                        placeholder:'Ingrese su contraseña'
                    }}
                    handleChange={handleChange}
                />
                </FormGroup>
                <Button className="btn-lg btn-dark btn-block">Entrar</Button>
            </Form>
        </div>
    )

}
export default Login
